/* harmony default export */ var btn_table = ({
  name: 'table',
  icon: faTable,
  title: '',
  action: {
    request: {
      title: '',
      type: 'form',
      body: [{
        name: 'row',
        title: '',
        type: 'dialog-input',
        default: '3'
      }, {
        name: 'col',
        title: '',
        type: 'dialog-input',
        default: '2'
      }, {
        name: 'align',
        title: '',
        type: 'dialog-select',
        param: {
          options: [{
            title: '',
            value: 1
          }, {
            title: '',
            value: 2
          }, {
            title: '',
            value: 3
          }]
        },
        default: 0
      }],

      callback(data) {
        let rowString = '';

        for (let i = 0; i < data.col; i++) {
          rowString += '|  ';
        }

        rowString += '|';
        let divString = '';

        for (let i = 0; i < data.col; i++) {
          if (data.align === 1) {
            divString += '| :----------- ';
          } else if (data.align === 2) {
            divString += '| :----------: ';
          } else if (data.align === 3) {
            divString += '| -----------: ';
          } else {
            divString += '| -----------: ';
          }
        }

        divString += '|';
        let outputString = rowString + '\n' + divString + '\n';

        for (let i = 0; i < data.row - 1; i++) {
          outputString += rowString + '\n';
        }

        return outputString;
      }

    }
  }
});
